        VgPopUpPassagemServiço,
        false
    );
    UpdateContext({loading: true});
    Patch(
        vgSWEventosParadas,
        LookUp(
            vgSWEventosParadas,
            ID = Frm_PassagemTurno_1.LastSubmit.ID
        ),
        {
            UsuarioPrincipal: vcUsuarioDesignadoPrincipal,
            UsuarioDesignadoSecundario: vcUsuarioDesignadoSecundario/*;
            Descricao: vcDescricao*/
        }
    );
    ResetForm(Frm_PassagemTurno_1);
    Navigate('FluxoAtividades 2.0');
    Navigate('FluxodeEND''s2.0');
