        {
            loading: false,
            vcDescricao: Blank(),
            vcEquipamentoEnvolvidoPrincipal: Blank(),
            vcUsuarioDesignadoSecundario: Blank(),
            vcUsuarioDesignadoPrincipal: Blank()
        }
    ),
